        function searchEmployee() {
            const keyword = document.getElementById('searchBox').value.trim().toLowerCase();
            const tbody = document.querySelector("#resultTable tbody");
            tbody.innerHTML = '';

            const filtered = employeeData.filter(emp => {
                return (
                    (emp.initial || '').toLowerCase().includes(keyword) ||
                    String(emp.employee_id).includes(keyword) ||
                    (emp.first_name || '').toLowerCase().includes(keyword) ||
                    (emp.last_name || '').toLowerCase().includes(keyword) ||
                    (emp.nickname || '').toLowerCase().includes(keyword) ||
                    (emp.area || '').toLowerCase().includes(keyword)
                );
            });

            filtered.forEach(emp => {
                const row = `<tr>
                    <td>${emp.initial}</td>
                    <td>${emp.employee_id}</td>
                    <td>${emp.prefix}</td>
                    <td>${emp.first_name}</td>
                    <td>${emp.last_name}</td>
                    <td>${emp.nickname}</td>
                    <td>${emp.area}</td>
                    <td>${emp.department}</td>
                    <td>${emp.birthdate}</td>
                    <td>${emp.age}</td>
                    <td>${emp.phone}</td>
                </tr>`;
                tbody.innerHTML += row;
            });
        }
    </script>
